import Foundation
import UIKit
class PokemonHelper {
    
    class func getPokemonIvTextColor(withIv iv:Double) -> UIColor
    {
        if iv >= 80 {
            return highIvColor
        }else if iv < 80 && iv >= 40 {
            return mediumIvColor
        }else if iv < 40 && iv >= 20 {
            return lowIvColor
        }else {
            return trashIvColor
        }
    }
    
    class func doSortPokemon(sortType: SortType?, reverse: Bool?)
    {
        if sortType == nil || reverse == nil{
            return
        }
        switch sortType! {
        case .Cp:
            if !reverse! {
                pokemonList.sort(by: { (first, second) -> Bool in
                    return first.cp > second.cp
                })
            }else {
                pokemonList.sort(by: { (first, second) -> Bool in
                    return first.cp > second.cp
                })
            }
            break
        case .Favorite:
            if !reverse! {
                pokemonList.sort(by: { (first, second) -> Bool in
                    if first.isFavorite && !second.isFavorite {
                        return true
                    }else if !first.isFavorite && second.isFavorite {
                        return false
                    }else {
                        if first.getIv() > second.getIv() {
                            if first.cp > second.cp {
                                return true
                            }else {
                                return false
                            }
                        }else {
                            return false
                        }
                    }
                })
            }else {
                pokemonList.sort(by: { (first, second) -> Bool in
                    if first.isFavorite && !second.isFavorite {
                        return false
                    }else if !first.isFavorite && second.isFavorite {
                        return true
                    }else {
                        if first.getIv() > second.getIv() {
                            return true
                        }else {
                            return false
                        }
                    }
                })
            }
            break
        case .Iv:
            if !reverse! {
                pokemonList.sort(by: { (first, second) -> Bool in
                    return first.getIv() > second.getIv()
                })
            }else {
                pokemonList.sort(by: { (first, second) -> Bool in
                    return first.getIv() < second.getIv()
                })
            }
            break
        case .MaxCp:
            break
        case .Name:
            if !reverse! {
                pokemonList.sort(by: { (first, second) -> Bool in
                    return first.pokemonId.toString() < second.pokemonId.toString()
                })
            }else {
                pokemonList.sort(by: { (first, second) -> Bool in
                    return first.pokemonId.toString() > second.pokemonId.toString()
                })
            }
            break
        case .Recent:
            if !reverse! {
                pokemonList.sort(by: { (first, second) -> Bool in
                    return first.creationTimeInMs > second.creationTimeInMs
                })
            }else {
                pokemonList.sort(by: { (first, second) -> Bool in
                    return first.creationTimeInMs < second.creationTimeInMs
                })
            }
            break
        default :
            break
        }
    }
    
    
